    false,nt"url": null,nt"notes": "April 2013 - Census data were downloaded
    for 2010 and appended to the county coverage. Upon further review by the ND GIS
    Technical Meeting at their April 2013 meeting, it was decided that the demographic
    data included with the previous county feature class would be dropped, leaving only
    basic information with the necessary relational fields intact for joining of Census
    data tables and other related North Dakota data.nnThe North Dakota county coverage
    was originally created by the North Dakota Geological Survey using US Census Bureau
    TIGER data in 1994. The source scale on these data was 1:100,000. Since its creation,
    with USGS Public Land Survey DLG data, and USGS DRG derived data. The North Dakota
    State Water Commission revamped this coverage by using the NDGS PLSS coverage (combination
    of ND PSC, USGS DLG and DRG 24k data) to obtain county boundaries that coincided
    with PLSS linework, and heads-up digitized irregular boundaries such as that on
    the State borders, and those that followed river/stream boundaries with USGS 1:24,000
    scale Digital Raster Graphics. The resultant coverage should be much better than
    a 1:100,000 scale coverage, but may not meet 1:24,000 scale accuracy standards.",nt"license_title":
